import React from 'react';
import { Link } from 'react-router-dom';

const Member = () => {
  return (
    <div className="dashboard">
      <h1>Simple Dashboard</h1>
      
      <div className="card">
        <h3>Member View</h3>
        <Link to="/MemberView" className="button">
          View Member
        </Link>
      </div>
    </div>
  );
};

export default Member;
